import React from 'react';

const AluguelOnibus = () => {
    return (
        <div style={{ padding: '20px' }}>
            <h1>Aluguel de Ônibus</h1>
            <p>Informações detalhadas sobre nossas opções de aluguel de ônibus para diversos tipos de viagem.</p>
        </div>
    );
};

export default AluguelOnibus;
